css:
.item-count-box {
  float: right;
  min-width: 26px;
  text-align: center;
  display: inline;
  font-size: 12px;
  padding: 1px 5px 1px 5px;
  margin-top: 3.5px;
  line-height: 20.9px;
  border-radius: 3px;
}
.contact-chip {
  padding-right: 6px;
  white-space: nowrap;
}
.contact-chip .contact-img {
  border-radius: 50%;
  margin-top: -2px;
  margin-right: 3px;
  height: 14px;
  width: 14px;
}
.contact-chip.clickable:hover {
  cursor: pointer;
  border-radius: 9px;
  background: #d9d9d9;
}
.contact-chip:not(:last-child):after {
  content: ',';
  display: inline;
}
